import React from 'react';
import './sendpage.css';
function SendPage() {
    return (
      <div className="sendpage">
          <div className="templateWrapper">
            <div className="template">
              <div className="templateName">
                 Template Name
              </div>
            </div>
          </div>  
      </div>
    );
  }

export default SendPage;
